import React from 'react';

import './buttons.css';

function SignIn() {
  return (
    <React.Fragment>
      <ul style={{ listStyleType: 'none' }}>
        <li style="sign-in">
          <button>Sign in</button>
        </li>
        <li style={{ display: 'inline' }}>
          <button>Getting Started</button>
        </li>
      </ul>
    </React.Fragment>
  );
}

export default SignIn;
